    <Fragment>
      <h1>Básicos React</h1>

      {/* <h2>{saludo}</h2> */}
      {/* <h2>{mensaje}</h2> */}

      <Header titulo="Tienda virtual" nombre="StarIT" />
      <h1>Lista de Productos</h1>
      {productos.map(producto => ( 
      <Producto producto={producto}/>

      ))}

      <Footer fecha={fecha}/>
    </Fragment>
  );
}

export default App;
